import React from 'react';

// STYLE
import styled, { css } from 'styled-components';

// ELEMENTS
import { Grid, Button, Input, TextArea } from '../elements/index';

const CommunityWrite = () => {
  const Options = [
    {key: 1, value:'게시글 주제를 선택해주세요.'},
    {key: 2, value:'방문수령'},
    {key: 3, value:'방문수령'},
    {key: 4, value:'방문수령'},
  ]

  return (
    <Grid 
      bgColor="bgColor" 
      height="80vh" 
      margin="auto"
      addstyle={() => {
        return css`
          position:relative;
          top:80px;
        `;
      }}
      >
      <CommunityWriteStyle>
        <Grid width="335px" height="10%">
          <Input placeholder="제목을 입력해주세요."/>
        </Grid>
        <Grid width="325px">
          <TextArea placeholder="내용을 입력해주세요." height="340px"/>
        </Grid>
      </CommunityWriteStyle>
    </Grid>
  );
};

const CommunityWriteStyle = styled.div`
  border: 2px solid rgb(${(props) => props.theme.palette.olive});
  width: 350px;
  height: 70vh;
  margin: 10px auto;
  border-radius: 30px;
`;

export default CommunityWrite;
